import "./topbar.css"

import React from 'react'

export default function TopBar() {
    return (
        <div className="top">
            <div className="topLeft"><i class="fab fa-facebook-square"></i></div>
            <div className="topCenter">C</div>
            <div className="topRight">R</div>
        </div>
    )
}
